package validatorpool

// EvmByteCode is the EVM bytecode of the validatorpool precompile. This code is
// returned by eth_getCode and ensures the precompile address is detected as a
// smart contract by external services. note: It should NOT contain a 0x prefix
//
// This bytecode was generated by compiling the ValidatorPoolCaller contract
// found in the precompile/hardhat package. Then extracting `deployedBytecode`
// from the build artifacts
//
// FIXME: The actual bytecode of the precompile is different due to a new method that was added (cleanupApplications).
//        From backward compatibility reasons, we cannot just change the byte code here
//        as this value is used in the InitChain ABCI hook and affects the app state hash.
//        We need to update the bytecode using a state migration being part of an on-chain upgrade.
//        At the same time, the chain can work with the old value as this is used just
//        to verify the precompile in the block explorer and does not impact other areas of the chain.
//        See: https://linear.app/thesis-co/issue/ENG-391/figure-out-how-to-handle-updates-of-byte-code-for-precompiles
//        The actual byte code is (see https://github.com/mezo-org/mezod/pull/334):
//        ""
//nolint:all
const EvmByteCode = ""
